function App() {
  return (
    <Router>
      <Routes>
        {/* Check token and role on initial route */}
        <Route
          path="/"
          element={
            localStorage.getItem('token') ? (
              // Check user role and redirect accordingly
              localStorage.getItem('user_role') === 'Technician' ? (
                <Navigate to="/TechnicianDashboard" />
              ) : localStorage.getItem('user_role') === 'Customer' ? (
                <Navigate to="/dashboard" />
              ) : (
                <Navigate to="/login" />
              )
            ) : (
              <Navigate to="/login" />
            )
          }
        />
        <Route path="/home" element={<Home />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />

        {/* Private Routes */}
        <Route
          path="/dashboard"
          element={
            <PrivateRoute element={<Dashboard />} allowedRoles={['Customer', 'Admin']} />
          }
        />
        <Route
          path="/TechnicianDashboard"
          element={
            <PrivateRoute element={<TechnicianDashboard />} allowedRoles={['Technician']} />
          }
        />

        <Route path="/update-profile" element={<PrivateRoute element={<UpdateProfile />} allowedRoles={['Customer', 'Admin', 'Technician']} />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />  {/* Route for forgot password */}
      </Routes>
    </Router>
  );
}
